import React from 'react';
import './App.css';
import SignIn from './components/SignIn/SignIn';
import NavBar from './components/navbar/NavBar';
import 'bootstrap/dist/css/bootstrap.css';
import Particles from 'react-particles-js';
import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
//The setting for the moving background
const backgroundOptions = {
	particles: {  
 		number: {
            value:150,
            density: {
            	enable:true, 
            	value_area:800
            }
        },	
    }
}

function App() {
  return (
    //This makes us be able to change what componets is displayed
    //based on URL. URL are set when nav buttons is clicked
    <BrowserRouter>
        <Switch>

        {/*Each Route is what will be seen at each URL*/}
            <Route path='/a' component= {{NavBar, SignIn}} />

    	  <SignIn/>




    	<Particles className='particles'
              params={backgroundOptions}

            />


        </Switch>
    </BrowserRouter>

  );
}

export default App;
